import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import homeback from "./photo/home back.webp";
import Navbar from "./nav";
export default function Home(){
    return(
         <div className="home">
            <div className="navdiv">
            <Navbar />
            </div>
            <div className="homewrite">
            <img className="homepic" src={homeback}></img>
                <h1 id="middlehome1">BE FABULOUS. BE EMPOWERED. BE BLOWN AWAY!</h1>
                <h3 id="middlehome2">We're Committed to Service Excellence By EliteLove</h3>
                </div>
         </div>
    );
}
